def _unstack_multiple(data, clocs, fill_value=None):
    if len(clocs) == 0:
        return data

    index = data.index

    clocs = [index._get_level_number(i) for i in clocs]
    rlocs = [i for i in range(index.nlevels) if i not in clocs]

    if isinstance(data, Series):
        dummy_index = Index(
            data.index.get_level_values(rlocs[0]).unique(), name="__placeholder__"
        )
        dummy = data.reindex(
            index=dummy_index, fill_value=fill_value, level=rlocs[0], copy=True
        )
    else:
        dummy_index = MultiIndex.from_tuples(
            data.index.to_flat_index(), names=index.names
        )
        dummy_data = data.reindex(index=dummy_index, fill_value=fill_value)

        level_values = [
            dummy_data.index.get_level_values(level).unique() for level in rlocs
        ]

        dummy_index = MultiIndex.from_product(level_values + [index.levels[clocs[0]]])
        dummy = dummy_data.reindex(index=dummy_index, copy=True)

        dummy.index = dummy_index
        dummy = dummy.unstack(level=-1)

    return dummy
